import React from "react";
import { View, Text, Image, StyleSheet } from "react-native";
import { RootTabScreenProps } from "../types";
import tw from "tailwind-react-native-classnames";
import { transform } from "@babel/core";
import { StatusBar } from "expo-status-bar";

export default function Game({ navigation }: RootTabScreenProps<"Game">) {
  return (
    <View style={tw`h-full flex flex-col `}>
      <View style={tw`h-2/4 w-full`} />
      <Image
        style={[ styles.logo, tw`` ]}
        source={require("../assets/images/pokeball.png")}
      />

      <View style={[ tw`h-2/4 w-full`, styles.player2 ]} />
      <StatusBar hidden />
    </View>
  );
}
const styles = StyleSheet.create({
  logo: {
    width: 70,
    height: 70,
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: [ { translateX: -35 }, { translateY: -32 } ],
    zIndex: 99,
  },
  player2: {
    backgroundColor: "#ED5564",
    borderTopWidth: 5,
    borderTopColor: "#434A54",
  },
});
